import React, { useEffect, useState } from 'react';
import { Link, useNavigate, useParams } from 'react-router-dom';

const EditStudent = () => {
  const { studentid } = useParams(); // URL-dən gələn ID
  const [id, setId] = useState(""); // Tələbənin ID-sini saxlayır
  const [name, setName] = useState(""); // Tələbənin adı
  const [place, setPlace] = useState(""); // Tələbənin ünvanı
  const [phone, setPhone] = useState(""); // Tələbənin telefonu
  const [validation, setValidation] = useState(false); // Validation üçün istifadə olunur
  const [loading, setLoading] = useState(true); // Loading statusu
  const navigate = useNavigate();

  useEffect(() => {
    console.log("Fetching data for student ID:", studentid);

    fetch(`http://localhost:3400/students/${studentid}`)
      .then((res) => {
        if (!res.ok) {
          throw new Error("Server error: " + res.status);
        }
        return res.json();
      })
      .then((data) => {
        setId(data.id);  // Tələbənin ID-sini state-ə yığırıq
        setName(data.name); // Tələbənin adını state-ə yığırıq
        setPlace(data.place); // Tələbənin ünvanını state-ə yığırıq
        setPhone(data.phone); // Tələbənin telefonunu state-ə yığırıq
        setLoading(false); // Yükləmə bitdi
      })
      .catch((err) => {
        console.error("Fetch error:", err.message);
        setLoading(false); // Yükləmə bitdi, amma səhv baş verdi
      });

  }, [studentid]);

  const handleSubmit = (e) => {
    e.preventDefault();

    // Validation yoxlaması
    if (!name || !place || !phone) {
      setValidation(true);
      return;
    }

    const studentData = { id, name, place, phone };

    fetch(`http://localhost:3400/students/${studentid}`, {
      method: 'PUT',
      headers: {
        "content-type": "application/json"
      },
      body: JSON.stringify(studentData)
    })
      .then((res) => {
        if (res.ok) {
          alert("Tələbə məlumatı uğurla düzəldildi!");
          navigate("/");  // Uğurlu düzəlişdən sonra əsas səhifəyə yönləndirir
        }
      })
      .catch((err) => console.error("Fetch error:", err));
  };

  // Dinamik validation mesajı
  const renderValidationMessage = (field, message) => {
    return field.length === 0 && validation && <span className='errorMsg'>{message}</span>;
  };

  if (loading) {
    return <div>Yüklənir...</div>; // Loading zamanı göstərilən mətn
  }

  return (
    <div className='container'>
      <h2>Tələbə Məlumatlarına Düzəliş et</h2>
      <form onSubmit={handleSubmit}>

        <label htmlFor="id">ID:</label>
        <input type="text" id="id" name="id" value={id} readOnly /> {/* ID sahəsi yalnız oxumaq üçün */}

        <label htmlFor="name">Adı:</label>
        <input
          type="text"
          id="name"
          name="name"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
        {renderValidationMessage(name, "Adınızı daxil edin")}

        <label htmlFor="place">Ünvan:</label>
        <input
          type="text"
          id="place"
          name="place"
          value={place}
          onChange={(e) => setPlace(e.target.value)}
        />
        {renderValidationMessage(place, "Ünvanınızı daxil edin")}

        <label htmlFor="phone">Nömrə:</label>
        <input
          type="text"
          id="phone"
          name="phone"
          value={phone}
          onChange={(e) => setPhone(e.target.value)}
        />
        {renderValidationMessage(phone, "Mobil nömrənizi daxil edin")}

        <div className='form-buttons'>
          <button className='btn btn-save'>Düzəliş</button>
          <Link to="/" className='btn btn-back'>Geri</Link>
        </div>
      </form>
    </div>
  );
};

export default EditStudent;
